#define OPTION_VAL_ACCURATE_TR "Kesin"
#define OPTION_VAL_FAST_TR "Hızlı"
#define GAMBATTE_GBC_FRONTLIGHT_POSITION_LABEL_TR "Renk Düzeltmesi - Ön Işık Konumu"
#define GAMBATTE_GBC_FRONTLIGHT_POSITION_INFO_0_TR "Game Boy Color LCD panelinin farklı açılardan aydınlatıldığında verdiği fiziksel tepkiyi taklit eder. 'Merkez' standart renk üretimini temsil eder. 'Ekran Üstü' parlaklığı artırır. 'Ekran Altı' parlaklığı azaltır. Bu ayar yalnızca 'Renk Düzeltme Türü', 'Kesin' olarak ayarlandığında geçerlidir."
#define OPTION_VAL_CENTRAL_TR "Merkez"
#define OPTION_VAL_ABOVE_SCREEN_TR "Ekran Üstü"
